import React from "react";

import { Card, Button } from "react-bootstrap";

function CardSpiceIn(props) {

    const title = props.title;
    const category = props.category;
    const spiceImg = `${process.env.REACT_APP_SERVER_DOMAIN}/public/Assests/Images/spiceIN/` +
    props.spiceImg;
  return (
    <Card className="position-relative my-2 mx-4 p-0 pt-0 pb-2">
      <a
        href="https://zom-in.com/spice-in_landing.php?url=The+Most+Practical+Christmas+Gifts"
        class="text-decoration-none text-dark m-0 p-0"
      >
        <img
          src={spiceImg}
          class="img-fluid mx-auto my-1 roundedImageCard border"
          alt="Spice-In"
        />
        <div class="m-2">
          <p class=" px-3 py-1 m-0 badge rounded-pill alert-primary fs-6 fw-normal text-dark">
            {category}
          </p>
        </div>
        <p class="p-0 my-0 mx-2 fs-5 lh-sm fw-bold text-truncate-3">
          {title}
        </p>
      </a>
    </Card>
  );
}

export default CardSpiceIn;
